                                    </div>
                                    <div className="col-md-1">
                                        <button className="btn btn-lg btn-primary btn-block " type="submit">-</button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Ip;
